import React from 'react'
import '../style.css';
import './Carousel.css';
import Carousel from './Carousel';


function AppCarousel() {

  React.render(
    <Carousel
      carouselItems={[
        <div>slide 1</div>,
        <div>slide 2</div>,
        <div>slide 3</div>
      ]}
    />,
    document.getElementById('root')
  );
}

export default AppCarousel;
